Pokemon Go players select a region and battle it to see where the opponent is and against whom they can reach. The map of the game follows the steps of the map:

Protect the Pokemon (it's very powerful)
Hide the location of the location of the Pokeon;
Frog on the surface of the map;
Check the surroundings around the place of the water;
Tutor on the other side;
Archer on the other side;
